void SpaceTextEditor_region_location_from_cursor_func(struct ID *_selfid, struct SpaceText *_self, int line, int column, int result[2])
{
	rna_SpaceTextEditor_region_location_from_cursor(_selfid, _self, line, column, result);
}

void SpaceTextEditor_region_location_from_cursor_call(bContext *C, ReportList *reports, PointerRNA *_ptr, ParameterList *_parms)
{
	struct ID *_selfid;
	struct SpaceText *_self;
	int line;
	int column;
	int *result;
	char *_data;
	
	_selfid = (struct ID *)_ptr->owner_id;
	_self = (struct SpaceText *)_ptr->data;
	_data = (char *)_parms->data;
	line = *((int *)_data);
	_data += 8;
	column = *((int *)_data);
	_data += 8;
	result = ((int *)_data);
	
	rna_SpaceTextEditor_region_location_from_cursor(_selfid, _self, line, column, result);
}

